import React from 'react';

import { NavLink } from 'react-router-dom';
import { IgW } from './components/components';
export const Home = () => (
	<main>
		<div
			className="obj-cover"
			style={{
				backgroundImage: `url(${require('/Users/tobias/WebDev/vxy/src/pages/nasa.jpg')}) cen`,
			}}
		>
			<header className="z-max mt4 ph5 pb5 w-100 flex justify-between">
				<div className="futura tracked-double white fw8 f2 ">SCAPIN TOBIAS</div>
				<div className="futura white f2 fw3 self-end">
					<IgW />
					<NavLink to="/progetti" className="ttu link white hover-gold ph3">
						progetti
					</NavLink>
					<NavLink to="/info" className="link white hover-gold ">
						INFO
					</NavLink>
					<div className="futura fw4 f6 ttu dib pl3">
						<p>Ita</p>
						<p>eng</p>
					</div>
				</div>
			</header>
		</div>
	</main>
);
